import Link from 'next/link';
import Navbar from '../components/Navbar';
import Sidebar from '../components/Sidebar';

const Index = () => (
    <>
        <div>
            <Navbar />
            <Sidebar />
        </div>
        <style jsx>{`
            html, body {
                margin: 0;
                padding: 0;
                height: 100%;
            }
        `}</style>
    </>
)

export default Index;
